import React from 'react'
import './Modal.css';
import { Data } from './Data';
function Modal(){
    return(
    <Data>
        <div className='title'>
            <h1>Profile</h1>
        </div>
        <div className='container'>
            <div className='container-personal'>
                <img src="./img/me.png"  />
            </div>
        </div>
    </Data>
    )
}
export default Modal;
